<!DOCTYPE html>
<!--	https://sapui5.hana.ondemand.com/versionoverview.html	-->

<html>
	<head>
		<meta charset="utf-8">
		<title>SAPUI5 Walkthrough</title>
		<script
			id="sap-ui-bootstrap"
			src="https://sapui5.hana.ondemand.com/resources/sap-ui-core.js"
			data-sap-ui-async="true"
			data-sap-ui-theme="sap_fiori_3"
			data-sap-ui-compatVersion="edge"
			data-sap-ui-resourceRoots='{"sap.ui.demo.walkthrough":"./"}'
			data-sap-ui-onInit="module:sap/ui/core/ComponentSupport"
			data-sap-ui-logLevel="TRACE"
		>
			
		</script>
	</head>
		
	
	<body class="sapUiBody" id="content"	>
		<div
			data-sap-ui-component
			data-name="sap.ui.demo.walkthrough"
			data-id="rootcontainer"
			data-settings='{"id":"rootcontainercomponent"}'
		></div>
		
	</body>
	
	
</html>
